  prepareDailyChart(last7DaysData:any,status:boolean){
    const result:any = {};

// Loop through the data array and populate the result object
    last7DaysData.forEach((item:any) => {
        const dateParts = item.date.split('-');
        const formattedDate = `${dateParts[0]} ${this.getMonthName(dateParts[1])}`;
        result[formattedDate] = item.sum;
      });
    const keys = Object.keys(result);
    const lastSevenKeys = keys.reverse();
    const values = Object.values(result);
    const lastSevenValues:any = values.reverse();
    
    console.log(lastSevenValues);
    const lastSevenValuesFloat = lastSevenValues.map((number:any) => parseFloat((number/100000).toFixed(2)));
    let maxNo =  Math.max.apply(Math, lastSevenValuesFloat);
    console.log('lastSevenKeys: - ',lastSevenKeys);
    // console.log('decemberData: - ',decemberData);
    if(!status){

      this.dailyChart = new Chart('salesOverView', {
        type: 'bar',
        data: {
          labels: lastSevenKeys,
          datasets: [{
            label: 'Sales in L',
            borderColor:'#e263e5',
            backgroundColor:'#e263e5',
            data: lastSevenValuesFloat,
            borderWidth: 1,
            barThickness:18
          }]
        },
        options: {
          responsive: true,
          maintainAspectRatio: false,
          scales: {
            
              x: {
                 grid: {
                    display: false
                 }
              },
              y: {
                 grid: {
                    display: true,
                    
                 },
                 suggestedMax:maxNo+5  
              
           },
           
          },
          plugins: {
            legend: {
              display: false,
           } ,
            // Change options for ALL labels of THIS CHART
            datalabels: {
              // color: '#36A2EB',
              anchor: 'end',
              align: 'end',
              formatter: function (value, context) {
                // Display the actual data value
                return value+' L';
            }
              // display:false
            },
          
          },
        }
      });
    }
    else{
      this.dailyChart.data.labels = lastSevenKeys;
      this.dailyChart.data.datasets[0].data = lastSevenValuesFloat;
      this.dailyChart.update();
    }
  }
